/**
* Function: paintVertexShape
* 
* Paints the vertex shape.
*/
mxShapeLeanTimeline.prototype.paintVertexShape = function(c, x, y, w, h)
{
	c.translate(x, y);

	var dy1 = mxUtils.getValue(this.style, 'dy1', '0');
	var dx2 = mxUtils.getValue(this.style, 'dx2', '0');
	var dy2 = mxUtils.getValue(this.style, 'dy2', '0');
	var dx3 = mxUtils.getValue(this.style, 'dx3', '0');
	var dy3 = mxUtils.getValue(this.style, 'dy3', '0');
	var dx4 = mxUtils.getValue(this.style, 'dx4', '0');
	var dy4 = mxUtils.getValue(this.style, 'dy4', '0');
	var dx5 = mxUtils.getValue(this.style, 'dx5', '0');
	var dy5 = mxUtils.getValue(this.style, 'dy5', '0');
	var dy6 = mxUtils.getValue(this.style, 'dy6', '0');
	
	var lastUp = true;

	c.begin();

	if (dy1 <= 0.5)
	{
		c.moveTo(0, 0);
		lastUp = true;
	}
	else
	{
		c.moveTo(0, h);
		lastUp = false;
	}

	//2
	if (dy2 <= 0.5 && lastUp)
	{
		c.lineTo(dx2, 0);
		lastUp = true;
	}
	else if (dy2 > 0.5 && !lastUp)
	{
		c.lineTo(dx2, h);
		lastUp = false;
	}
	else if (dy2 <= 0.5 && !lastUp)
	{
		c.lineTo(dx2, h);
		c.lineTo(dx2, 0);
		lastUp = true;
	}
	else
	{
		c.lineTo(dx2, 0);
		c.lineTo(dx2, h);
		lastUp = false;
	}
		
	//3
	if (dy3 <= 0.5 && lastUp)
	{
		c.lineTo(dx3, 0);
		lastUp = true;
	}
	else if (dy3 > 0.5 && !lastUp)
	{
		c.lineTo(dx3, h);
		lastUp = false;
	}
	else if (dy3 <= 0.5 && !lastUp)
	{
		c.lineTo(dx3, h);
		c.lineTo(dx3, 0);
		lastUp = true;
	}
	else
	{
		c.lineTo(dx3, 0);
		c.lineTo(dx3, h);
		lastUp = false;
	}
		
	//4
	if (dy4 <= 0.5 && lastUp)
	{
		c.lineTo(dx4, 0);
		lastUp = true;
	}
	else if (dy4 > 0.5 && !lastUp)
	{
		c.lineTo(dx4, h);
		lastUp = false;
	}
	else if (dy4 <= 0.5 && !lastUp)
	{
		c.lineTo(dx4, h);
		c.lineTo(dx4, 0);
		lastUp = true;
	}
	else
	{
		c.lineTo(dx4, 0);
		c.lineTo(dx4, h);
		lastUp = false;
	}
		
	//5
	if (dy5 <= 0.5 && lastUp)
	{
		c.lineTo(dx5, 0);
		lastUp = true;
	}
	else if (dy5 > 0.5 && !lastUp)
	{
		c.lineTo(dx5, h);
		lastUp = false;
	}
	else if (dy5 <= 0.5 && !lastUp)
	{
		c.lineTo(dx5, h);
		c.lineTo(dx5, 0);
		lastUp = true;
	}
	else
	{
		c.lineTo(dx5, 0);
		c.lineTo(dx5, h);
		lastUp = false;
	}
		
	//6
	if (dy6 <= 0.5 && lastUp)
	{
		c.lineTo(w, 0);
		lastUp = true;
	}
	else if (dy6 > 0.5 && !lastUp)
	{
		c.lineTo(w, h);
		lastUp = false;
	}
	else if (dy6 <= 0.5 && !lastUp)
	{
		c.lineTo(w, h);
		c.lineTo(w, 0);
		lastUp = true;
	}
	else
	{
		c.lineTo(w, 0);
		c.lineTo(w, h);
		lastUp = false;
	}
		
	//end
	c.stroke();
};

