	c.moveTo(w * 0.12, h * 0.122);
	c.lineTo(w * 0.8738, h * 0.8837);
	
	c.moveTo(w * 0.5, 0);
	c.lineTo(w * 0.55, h * 0.05);
	c.lineTo(w * 0.45, h * 0.15);
	c.lineTo(w * 0.55, h * 0.25);
	c.lineTo(w * 0.45, h * 0.35);
	c.lineTo(w * 0.55, h * 0.45);
	c.lineTo(w * 0.49, h * 0.5);
